import React from "react";
import "./score.css"

//Stateless component for score
const Score = props => (
  <div className="gameScore">
    <h3 className="score">Your Score: {props.total}/12</h3>
    <h3 className="status">{props.status}</h3>
  </div>
);

export default Score;
